import React, {useEffect} from 'react';

import Charger from '../components/Charger.js'
import { fetchSession } from "../services/charger/fetchSessionService";
import {fetchChargers} from "../services/charger/fetchChargersService";

/**
 * @author Magnus
 * Komponenten er siden med Charger-komponent.
 *
 * @component
 */

function ChargerPage({ match }) {

    useEffect(() => {
        console.log(fetchChargers())
    })


    return (
        <div className="scopeContent">
            <Charger chargerId={match.params.id}
                     name="Gutta ladærn"
                     owner="Sven Sørensen"
                     interval={8}/>
        </div>
    );
}

export default ChargerPage;
